import style from "./PopupHandler.module.css"
import react from "react"
import $ from 'jquery'

const PopupHandler = props => {
    const PopupContent = <div className={style["dropdown"]}>
        {props.children}
    </div>

    return react.createPortal(PopupContent,$('#popup'))
}

export default PopupHandler
